import React, { useState } from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import Login from 'components/loginpage.js';
import 'bootstrap/dist/css/bootstrap.min.css'

ReactDOM.render(
  <React.StrictMode>
    <App />
    <Login />
  </React.StrictMode>,
  document.getElementById('root')
);
